import React from 'react';
import { useParams } from 'react-router-dom';
import { Helmet } from 'react-helmet';

const Logement = () => {
  const { id } = useParams();
  return (
    <div>
      <Helmet>
        <title>Logement {id} - My React App</title>
      </Helmet>
      <h1>Logement {id}</h1>
    </div>
  );
};

export default Logement;
